import React, { Component, Fragment } from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";
import Logo from "../img/login/logo.svg";
import LogoWhite from "../img/login/logo-white.svg";

// material ui
import withStyles from "@material-ui/core/styles/withStyles";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Button from "@material-ui/core/Button";
import Alert from "@material-ui/lab/Alert";
import { IconButton } from "@material-ui/core";
import AccountCircleIcon from "@material-ui/icons/AccountCircle";
import Hidden from "@material-ui/core/Hidden";
//redux
import { connect } from "react-redux";

// User menu component
import UserMenu from "./UserMenu";

// material ui style
const styles = (theme) => ({
  ...theme.nav,
  appbar: {
    [theme.breakpoints.down("sm")]: {
      background: "transparent",
    },
    //marginTop: 48,
    [theme.breakpoints.down("xs")]: {
      //marginTop: 68,
    },
    zIndex: theme.zIndex.drawer + 1,
  },

  logo: {
    // [theme.breakpoints.down("sm")]: {
    //   display: "none",
    // },
    width: "120px",
    height: "40px",
    align: "left",
    position: "relative",
    marginLeft: -10,
  },
  logowhite: {
    // [theme.breakpoints.up("md")]: {
    //   display: "none",
    // },

    width: "96px",
    height: "28px",
    align: "left",
    position: "relative",
  },
  // covidAlert: {
  //   justifyContent: "center",
  //   zIndex: theme.zIndex.drawer + 1,
  //   //position: "absolute",
  // },

  // covidInfo: {
  //   textDecoration: "underline",
  // },
});
class Navbar extends Component {
  render() {
    const { classes } = this.props;
    const { authenticated } = this.props;

    return (
      <div>
        {/* <Alert
          severity="error"
          component={Link}
          to="/covid19"
          className={classes.covidAlert}
        >
          <strong className={classes.covidInfo}>
            COVID-19: Information on Symptoms, Testing and Treatments
          </strong>
        </Alert> */}

        <AppBar className={classes.appbar} position="fixed">
          <Toolbar className="nav-container">
            <Button component={Link} to="/">
              <Hidden only={["xs", "sm"]}>
                <img src={Logo} alt="logo" className={classes.logo} />
              </Hidden>
              <Hidden only={["md", "lg"]}>
                <img src={LogoWhite} alt="logo" className={classes.logowhite} />
              </Hidden>
            </Button>
            {authenticated ? (
              <Fragment>
                <UserMenu />
              </Fragment>
            ) : (
              <Fragment>
                <Hidden only={["md", "lg"]}>
                  <IconButton
                    className={classes.iconButton}
                    component={Link}
                    to="/login"
                  >
                    <AccountCircleIcon
                      color="primary"
                      style={{ fontSize: 28 }}
                    />
                  </IconButton>
                </Hidden>
                <Hidden only={["xs", "sm"]}>
                  <Button
                    className={classes.navButton}
                    size="small"
                    variant="outlined"
                    color="inherit"
                    component={Link}
                    to="/login"
                  >
                    Login / Sign up
                  </Button>
                </Hidden>
              </Fragment>
            )}
          </Toolbar>
        </AppBar>
      </div>
    );
  }
}

Navbar.propTypes = {
  authenticated: PropTypes.bool.isRequired,
};

const mapStateToProps = (state) => ({
  authenticated: state.user.authenticated,
});

export default connect(mapStateToProps)(withStyles(styles)(Navbar));
